import { useEffect, useState} from 'react';


const HOME = () => {

    const [data, setData] = useState([[]]);

    useEffect(() => {
        (async () => {
            const response = await axios.get(
              "http://localhost:4000/video"
            );

            setData(response.data[0]);
        })();
      }, []);


    return(
        <>
            <div>
                <video src={data} />
            </div>
        </>
    );


};

export default HOME;
